import React from "react";
import styled from "styled-components";
import { Breadcrumbs } from "../components/pageSpecific/products/PageTitle";
import { Container } from "../components/layout/Container";
import ImageOverlap from "../components/pageSpecific/products/ImageOverlap";
import { ThreeImages } from "../components/pageSpecific/products/ThreeImages";

const WindowsTemplate = ({
  title,
  detailsTitle,
  detailsChildren,
  imageSrc,
  imageTitle,
  imageChildren,
  productImage1,
  productImage2,
  productImage3,
}) => {
  const links = [
    {
      name: "Design Options",
      href: "/sub/designoptions",
    },
    {
      name: "Energy Efficiency",
      href: "/sub/learn",
    },
    {
      name: "Find a Dealer",
      href: "/sub/dealerfinder",
    },
  ];

  return (
    <Container space gap>
      <Breadcrumbs links={links} title={title} parent="Windows" />
      <ImageOverlap
        detailsTitle={detailsTitle}
        detailsChildren={detailsChildren}
        imageSrc={imageSrc}
        imageTitle={imageTitle}
        imageChildren={imageChildren}
      />
      <ThreeImages
        imageSrc1={productImage1}
        imageSrc2={productImage2}
        imageSrc3={productImage3}
      />
    </Container>
  );
};

export default WindowsTemplate;
